          <img src="./img/gabi.jpg"/>
        </div>
        <div>
          <span>Desenvolvedora Fullstack PHP</span><br></br>
          <span>Cursando Ciência da Computação</span>
        </div>
      </div>



    </div>
  );
}

export default App;
